/**
 * This module contains compressed game data blobs and utilities for handling them.
 * The data is stored in zlib-compressed, base64-encoded format for efficient storage and transmission.
 * Each blob represents different types of game data like collectibles, missions, locations etc.
 */

const COLLECTIBLES_COMPRESSED =
  '';
const MISSIONSETS_COMPRESSED =
  '';
const UNLOCKABLES_COMPRESSED =
  '';

// Compressed array data structures
const LOCATIONS_COMPRESSED =
  '';
const REWARDS_COMPRESSED =
  '';

// Decompress and parse the data blobs into usable JavaScript objects
const COLLECTIBLES = loadYamlBlob(COLLECTIBLES_COMPRESSED);
const MISSIONSETS = loadYamlBlob(MISSIONSETS_COMPRESSED);
const UNLOCKABLES = loadYamlBlob(UNLOCKABLES_COMPRESSED);
const LOCATIONS = loadArrayBlob(LOCATIONS_COMPRESSED);
const REWARDS = loadArrayBlob(REWARDS_COMPRESSED);

/**
 * Loads and parses a compressed YAML blob into a JavaScript object.
 * @param {string} blob - The base64 encoded, zlib compressed YAML data
 * @returns {Object|null} The parsed YAML data as a JavaScript object, or null if loading fails
 */
function loadYamlBlob(blob) {
  const decompressed = decompressBlob(blob);
  const data = jsyaml.load(decompressed);
  if (!data) {
    alert(`${key} data not loaded!`);
    return;
  }
  return data;
}

/**
 * Loads and parses a compressed array blob into a JavaScript array.
 * The blob is expected to be a comma-separated string when decompressed.
 * @param {string} blob - The base64 encoded, zlib compressed array data
 * @returns {Array|null} The parsed array, or null if loading fails
 */
function loadArrayBlob(blob) {
  const decompressed = decompressBlob(blob);
  const data = decompressed.split(',');
  if (!Array.isArray(data) || data.length === 0) {
    alert(`${key} data not loaded!`);
    return;
  }
  return data;
}

/**
 * Decompresses a base64 encoded, zlib compressed blob into a string.
 * @param {string} blob - The base64 encoded, zlib compressed data
 * @returns {string} The decompressed string data
 */
function decompressBlob(blob) {
  const compressed = Uint8Array.from(atob(blob), (c) => c.charCodeAt(0));
  const decompressed = pako.inflate(compressed, { to: 'string' });
  return decompressed;
}
